// src/components/MainInterface.js
import { signInWithPopup, signOut } from 'firebase/auth';
import { auth, provider } from '../firebase';
import { useState } from 'react';
import logo from '../assets/logo.jpg';
import './MainInterface.css';

const MainInterface = () => {
  const [user, setUser] = useState(null);
  
  // Partner hospitals data
  const partnerHospitals = [
    { district: 'Palnadu', count: 5 },
    { district: 'Guntur', count: 12 },
    { district: 'Ongole', count: 8 }
  ];

  const handleSignIn = async () => {
    try {
      const result = await signInWithPopup(auth, provider);
      setUser(result.user);
    } catch (error) {
      console.error("Sign-in error:", error);
    }
  };

  return (
    <div className="main-interface">
      {/* Navbar Section */}
      <nav className="navbar">
        <div className="navbar-left">
          <img src={logo} alt="Company Logo" className="logo" />
          <h1>Happy Doctors Consultancy</h1>
        </div>

        <div className="navbar-middle">
          <select className="district-select">
            <option value="">Our Partner Hospitals</option>
            {partnerHospitals.map((hospital, index) => (
              <option key={index} value={hospital.district}>
                {hospital.district} ({hospital.count} Hospitals)
              </option>
            ))}
          </select>
        </div>

        <div className="navbar-right">
          {user ? (
            <div className="user-profile">
              <img src={user.photoURL} alt="Profile" className="user-avatar" />
              <button onClick={() => signOut(auth).then(() => setUser(null))}>
                Sign Out
              </button>
            </div>
          ) : (
            <button className="google-signin" onClick={handleSignIn}>
              <img 
                src="https://upload.wikimedia.org/wikipedia/commons/5/53/Google_%22G%22_Logo.svg" 
                alt="Google logo" 
                className="google-icon"
              />
              Sign in
            </button>
          )}
        </div>
      </nav>

      {/* Main Content Section */}
      <div className="content">
        <div className="hero">
          <div className="hero-text">
            <h2>Save up to 50% on Medical Bills</h2>
            <p>
              With Happy Doctors Health Card, enjoy significant discounts at {partnerHospitals.reduce((acc, curr) => acc + curr.count, 0)} 
              partner hospitals across Andhra Pradesh.
            </p>
            <button className="cta-button">
              Get Your Health Card Now
            </button>
          </div>
          <div className="hero-image">
            <img src="/healthcard-sample.png" alt="Health Card Example" />
          </div>
        </div>

        <div className="benefits">
          <h3>Why Choose Us?</h3>
          <div className="benefits-grid">
            <div className="benefit-card">
              <div className="benefit-icon">üí∞</div>
              <h4>Cost Savings</h4>
              <p>Reduce OP charges by 30-50% at private hospitals</p>
            </div>
            <div className="benefit-card">
              <div className="benefit-icon">üè•</div>
              <h4>Wide Network</h4>
              <p>Access to {partnerHospitals.length} districts coverage</p>
            </div>
            <div className="benefit-card">
              <div className="benefit-icon">‚ö°</div>
              <h4>Instant Activation</h4>
              <p>Digital card available immediately after payment</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainInterface;
